// src/pages/Profile.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import "./Profile.css";

const API = process.env.REACT_APP_API_URL || "http://localhost:5000";

export default function Profile() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [debug, setDebug] = useState({ ok: true, details: null });

  useEffect(() => {
    async function fetchProfile() {
      setLoading(true);
      setDebug({ ok: true, details: null });
      try {
        const token = localStorage.getItem("token");
        console.log("Profile.fetchProfile token:", token);
        const headers = token ? { Authorization: `Bearer ${token}` } : {};
        const res = await axios.get(
          `${API}/users/profile`,
          { headers, validateStatus: () => true }
        );
        console.log("Profile fetch response:", res.status, res.data);
        if (res.status === 200) {
          setUser(res.data);
          setDebug({ ok: true, details: `200 OK` });
        } else {
          setUser(null);
          setDebug({
            ok: false,
            details: `Status ${res.status} - ${JSON.stringify(res.data)}`,
          });
        }
      } catch (err) {
        console.error("Profile fetch error:", err);
        setDebug({ ok: false, details: err.message || String(err) });
        setUser(null);
      } finally {
        setLoading(false);
      }
    }
    fetchProfile();
  }, []);

  if (loading)
    return (
      <div className="page-wrap">
        <div className="muted">Loading profile...</div>
      </div>
    );

  if (!user) {
    return (
      <div className="page-wrap">
        <div className="profile-card">
          <div className="panel">
            <div className="panel-title">Profile load failed</div>
            <div className="panel-body">
              <div style={{ marginBottom: 8 }}>
                Debug: {debug.ok ? "ok" : "error"}
              </div>
              <pre
                style={{
                  whiteSpace: "pre-wrap",
                  color: "#f2a",
                  fontSize: 13,
                }}
              >
                {String(debug.details)}
              </pre>
              <div style={{ marginTop: 10 }}>
                Checks:
                <ul>
                  <li>
                    Is localStorage token present? (console:
                    localStorage.getItem("token"))
                  </li>
                  <li>
                    Is API URL correct? (REACT_APP_API_URL or default
                    http://localhost:5000)
                  </li>
                  <li>
                    Server logs for requests — look for incoming GET
                    /users/profile
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="page-wrap">
      <div className="profile-card">
        <div className="profile-header">
          <div className="profile-left">
            {user.avatarUrl ? (
              <img
                src={user.avatarUrl}
                alt={user.name}
                className="profile-avatar-img"
              />
            ) : (
              <div className="profile-avatar-fallback">
                {(user.name || user.username || "U")
                  .slice(0, 2)
                  .toUpperCase()}
              </div>
            )}
          </div>
          <div className="profile-main">
            <div className="profile-title">{user.name || user.username}</div>
            <div className="profile-username">
              {user.username ? `@${user.username}` : ""}
            </div>
            <div className="profile-bio">{user.bio || "No bio yet."}</div>
          </div>
        </div>

        <div className="profile-body">
          <div className="left-col">
            <div className="panel">
              <div className="panel-title">Overview</div>
              <div className="panel-body">
                <div>
                  Member since:{" "}
                  {user.createdAt
                    ? new Date(user.createdAt).toLocaleDateString()
                    : "—"}
                </div>
                <div>
                  Problems solved: {(user.stats && user.stats.solved) || 0}
                </div>
              </div>
            </div>
          </div>

          <aside className="right-col">
            <div className="panel">
              <div className="panel-title">Contact</div>
              <div className="panel-body">{user.email || "No email"}</div>
            </div>
          </aside>
        </div>
      </div>
    </div>
  );
}
